import React from "react";
import { useNavigate } from "react-router-dom";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from "react-responsive-carousel";
import "../styles/Home.css";

function Home() {
  const navigate = useNavigate();

  return (
    <div>
      <div className="carousel-container">
        <Carousel
          emulateTouch={true}
          infiniteLoop={true}
          autoPlay={true}
          dynamicHeight={true}
          className="carousel"
          onClickItem={() => navigate("/frontpage")}
        >
          <div className="carousel-item">
            <img
              className="carousel-img"
              src="https://i.ytimg.com/vi/syNDdIfKbkw/maxresdefault.jpg"
            />
          </div>
          <div className="carousel-item">
            <img
              className="carousel-img"
              src="https://i.ytimg.com/vi/TllvFtkXMBE/maxresdefault.jpg"
            />
          </div>
          <div className="carousel-item">
            <img
              className="carousel-img"
              src="https://oncenoticias.digital/wp-content/uploads/2022/08/Scorpions.jpg"
            />
          </div>
        </Carousel>
      </div>
    </div>
  );
}

export default Home;
